text:
you might question so who exactly is @abbygodwinmusic ⁩ ? - another “uk gospel music artist” [you: 🙄], but you’d be wrong. i am human, been broken, sometimes shattered, done the breaking #nolieshere #vulnerabilityisnotweakness; 
but the one thing that has remained constant, kept me sane even when i look like i have lost my mind “is to worship” whether shattered, angry, frustrated, tired or my personally coined version mumble worship! cause my heart wants to, but my mind is tired. 
hence why i can tell you he is “unsearchable” he loves regardless❤️ #verythankful #metoo #metoomovement 
@laolufaj thank you for having me at #40tilb40 and allowing this moment to happen.

